{"title":"single-service-metrics-tree-map","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "padding": 5,

  "signals": [
    {
      "name": "labels", "value": true,
      "bind": {"input": "checkbox"}
    },
    {
      "name": "layout", "value": "tidy",
      "bind": {"input": "radio", "options": ["tidy", "cluster"]}
    },
    {
      "name": "links", "value": "diagonal",
      "bind": {
        "input": "select",
        "options": ["line", "curve", "diagonal", "orthogonal"]
      }
    },
    {
      "name": "separation", "value": false,
      "bind": {"input": "checkbox"}
    }
  ],

  "data": [
{
  "name": "raw-data",
  "values": [
     {"id": 0, "name": "recommendationservice"},
    {"id": 1, "name": "system", "parent": 0},
    {"id": 2, "name": "disk", "parent": 1},
    {"id": 3, "name": "io", "parent": 2},
    {"id": 4, "name": "operations", "parent": 2},
    {"id": 5, "name": "time", "parent": 2},
    {"id": 6, "name": "calls", "parent": 0},
    {"id": 7, "name": "duration", "parent": 0},
    {"id": 8, "name": "cpu", "parent": 1},
    {"id": 9, "name": "time", "parent": 8},
    {"id": 10, "name": "utilization", "parent": 8},
    {"id": 11, "name": "network", "parent": 1},
    {"id": 12, "name": "dropped_packets", "parent": 11},
    {"id": 13, "name": "errors", "parent": 11},
    {"id": 14, "name": "io", "parent": 11},
    {"id": 15, "name": "packets", "parent": 11},
    {"id": 16, "name": "memory", "parent": 1},
    {"id": 17, "name": "usage", "parent": 16},
    {"id": 18, "name": "utilization", "parent": 16},
    {"id": 19, "name": "process", "parent": 0},
    {"id": 20, "name": "runtime", "parent": 19},
    {"id": 21, "name": "cpython", "parent": 20},
    {"id": 22, "name": "gc_count", "parent": 21},
    {"id": 23, "name": "connections", "parent": 11},
    {"id": 24, "name": "swap", "parent": 1},
    {"id": 25, "name": "usage", "parent": 24},
    {"id": 26, "name": "utilization", "parent": 24},
    {"id": 27, "name": "cpu_time", "parent": 21},
    {"id": 28, "name": "memory", "parent": 21},
    {"id": 29, "name": "app_recommendations_counter", "parent": 0},
    {"id": 30, "name": "thread_count", "parent": 1}
  ]
},

    {
      "name": "tree",
      "source":"raw-data",
      "transform": [
        {
          "type": "stratify",
          "key": "id",
          "parentKey": "parent"
        },
        {
          "type": "lookup",
          "from": "raw-data",
          "key": "id",
          "fields": ["parent"],
          "as": ["parentData"]
        },
        {
          "type": "tree",
          "method": {"signal": "layout"},
          "size": [{"signal": "height"}, {"signal": "width - 100"}],
          "separation": {"signal": "separation"},
          "as": ["y", "x", "depth", "children"]
        }
      ]
    },
    {
      "name": "links",
      "source": "tree",
      "transform": [
        { "type": "treelinks" },
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": {"signal": "links"}
        },
        {
          "type": "formula",
          "as": "parentName",
          "expr": "datum.source.name"
        }
      ]
    }
  ],

  "scales": [
    {
      "name": "parentColor",
      "type": "ordinal",
      "domain": {"data": "tree", "field": "parent"},
      "range": {"scheme": "category20"}
    }
  ],

  "marks": [
    {
      "type": "path",
      "from": {"data": "links"},
      "encode": {
        "update": {
          "path": {"field": "path"},
          "stroke": {"value": "#ccc"}
        }
      }
    },
    {
      "type": "symbol",
      "from": {"data": "tree"},
      "encode": {
        "enter": {
          "size": {"value": 200},
          "stroke": {"value": "#fff"}
        },
        "update": {
          "x": {"field": "x"},
          "y": {"field": "y"},
          "fill": {"scale": "parentColor", "field": "parent"},
          "size": {"signal": "datum.children ? 150 : 200"}, 
          "shape": {"signal": "datum.children ? 'circle' : 'square'"}, 
          "strokeWidth": {"value": 1.5}
        },
        "hover": {
          "size":{"value": 400},
          "tooltip": {
            "signal": "datum.parentData ? {'Name': datum.name, 'Parent Group': datum.parentData.name} : {'Name': datum.name}"

          }
        }
      }
    },
    {
      "type": "text",
      "from": {"data": "tree"},
      "encode": {
        "enter": {
          "fill": {"value": "black"},
          "text": {"field": "name"},
          "fontSize": {"value": 12},
          "baseline": {"value": "middle"}
        },
        "update": {
          "x": {"field": "x"},
          "y": {"field": "y"},
          "dx": {"signal": "datum.children ? -7 : 7"},
          "align": {"signal": "datum.children ? 'right' : 'left'"},
          "opacity": {"signal": "labels ? 1 : 0"}
        }
      }
    }
  ]
}
"}}

{"title":"traces-gantt-chart","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json",

  "data": {
  "url" :{
      "%context%": "true",
      "%timefield%": "startTime",
      "index": "otel-v1-apm-span-*",
      "body": {
        "size": 75
      }
    }
    "format":{
      "type": "json",
      "property":"hits.hits"
    }
  },
  "transform": [
{"calculate": "datum._source.durationInNanos / 1000000", "as": "durationInMs"},
      {
    "window": [
      {
        "op": "max",
        "field": "durationInMs",
        "as": "maxDuration"
      }
    ],
    "frame": [null, null]
  },
  {
    "calculate": "datum.durationInMs / datum.maxDuration",
    "as": "normalizedDuration"
  },
  { "calculate": "datum._source.traceGroup", "as": "traceGroup"},
    {      "calculate": "toDate(datum._source.startTime)", "as": "currentDate"},
            {      "calculate": "toDate(datum._source.startTime)", "as": "startTime"},
  {
    "calculate": "format(datum.durationInMs, '.1f') + 'ms'",
    "as": "formattedDuration"
  },    {
      "calculate": "toDate(datum._source.endTime)",  "as": "endTime" },
    {
      "window": [{"op": "row_number", "as": "running_number"}],
      "groupby": ["_source.traceId"],
      "sort": [{"field": "currentDate"}]
    },
    {
      "calculate": "datum._source.traceId + ' | ' + datum._source.serviceName + ' | Start:' + toDate(datum._source.startTime) + ' #' + datum['running_number']",
      "as": "project_full_descr"
    }
  ],

  "title": {
    "text": "Order Gantt by: Trace > Span",
    "fontSize": 14,
    "anchor": "start",
    "dy": -15,
    "color": "#706D6C"
  },
  "layer": [
    {
      "mark": {
        "type": "bar",
        "tooltip": true,
        "cornerRadiusTopRight": 4,
        "cornerRadiusBottomRight": 4
      },
      "encoding": {
        "y": {
          "field": "project_full_descr",
          "type": "nominal",
          "sort": {"field": "startTime", "order": "ascending"},
          "axis": {
            "domain": true,
            "grid": true,
            "ticks": true,
            "labels": true,
            "labelLimit": 800,
            "labelFontSize": 12,
            "labelPadding": 10,
            "labelExpr": "split(datum.label, '|')[1]"
          },
        "scale": {
            "padding": 0.5
          },
          "title": null
        },
        "x": {
          "field": "_source.startTime",
          "type": "temporal",
          "title": "time"
        },
        "x2": {"field": "_source.endTime"},
         "color": {
          "field": "_source.serviceName",
          "type": "nominal",
          "legend": {"title": "Service Name"},
          "scale": {"scheme": "category10"}
        },
          "opacity": {
    "field": "normalizedDuration",
    "legend":null,
    "type": "quantitative",
    "scale": {"domain": [0, 1], "range": [0.2, 1]}
  },
        "tooltip": [
          {"field": "_source.serviceName", "title": "Service Name"},
          {"field": "formattedDuration", "title": "Duration"},
          {"field": "_source.traceId", "title": "Trace ID"},
          {"field": "_source.traceGroup", "title": "Trace Group"}
        ]
      }
    },
    {
      "mark": {"type": "rule", "strokeDash": [2, 2], "strokeWidth": 2},
      "encoding": {
        "x": {
          "field": "currentDate",
          "type": "temporal"
        }
      }
    },
    {
      "mark": {
        "type": "text",
        "align": "right",
        "dx": -24,
        "dy": 0,
        "fontSize": 9
      },
      "encoding": {
        "x": {"field": "startTime"},
        "y": {"field": "project_full_descr", "type": "nominal",
                "sort": {"field": "startTime", "order": "ascending"}
},
        "text": {"field": "formattedDuration"},
        "color": {"value": "white"}
      }
    },
    {
      "mark": {
        "type": "text",
        "align": "left",
        "dx": 5,
        "dy": 0,
        "fontSize": 9
      },
      "encoding": {
        "x": {"field": "endTime"},
        "y": {"field": "project_full_descr", "type": "nominal", "sort": {"field": "startTime", "order": "ascending"}},
        "text": {"field": "formattedDuration"},
        "color": {"value": "black"}
      }
    },

  ],
  "config": {"view": {"stroke": null}}
}"}}

{"title":"multi-line-selectable-date-services-request-rate","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "title": "Services Requests Rate",
  "data": [
    {
      "name": "rawdata",
      "url": {
        "index": "otel-v1-apm-span-*",
        "%context%": true,
        "%timefield%": "startTime",
        "body": {
          "aggs": {
            "services": {
              "terms": {
                "field": "serviceName",
                "size": 15
              },
              "aggs": {
                "time_buckets": {
                  "date_histogram": {
                    "field": "startTime",
                    "interval": {"%autointerval%": true},
                    "extended_bounds": {
                      "min": {"%timefilter%": "min"},
                      "max": {"%timefilter%": "max"}
                    },
                    "min_doc_count":0
                  },
                  "aggs": {
                    "duration": {
                      "avg": {
                        "missing": 0,
                        "script": {
                          "source": "!doc.containsKey('durationInNanos') || doc['durationInNanos'].empty ? 0 : doc['durationInNanos'].value / 1000000.0",
                          "lang": "painless"
                        }
                      }
                    }
                  }
                }
              }
            }
          },
          "size": 0
        }
      },
      "format": {"property": "aggregations.services.buckets"}
    },
    {
      "name": "flatdata",
      "source": "rawdata",
      "transform": [
        {
          "type": "flatten",
          "fields": ["time_buckets.buckets"],
          "as": ["val"]
        },
        {
          "type": "formula",
          "as": "count",
          "expr":"datum.val.doc_count"
        },
        {
          "type": "formula",
           "as": "duration",
           "expr": "datum.val.duration.value == null ? 0 : datum.val.duration.value"
         },
        {
          "type": "formula",
          "as": "time",
          "expr": "timeFormat(utcParse(datum.val.key_as_string,'%Y-%m-%dT%H:%M:%S.%LZ'), '%B %d, %Y %H:%M')"
        }
      ]
    },
    {
      "name": "hasSelection",
      "values": [{}],
      "transform": [
        {"type": "filter", "expr": "selected[0] != selected[1]"}
      ]
    }
  ],
  "scales": [
    {
      "name": "groupScale",
      "type": "band",
      "padding": 0.1,
      "domain": {"data": "rawdata", "field": "key", "sort": true},
      "range": "height"
    },
    {
      "name": "xScale",
      "type": "time",
      "domain": {"data": "flatdata", "field": "val.key"},
      "range": "width",
      "padding": 5
    },
    {
      "name": "durationScale",
      "type": "linear",
      "domain": {"data": "flatdata", "field": "duration"},
      "range": [{"signal": "bandwidth('groupScale')"}, 0]
    },
    {
      "name": "yScale",
      "type": "linear",
      "domain": {"data": "flatdata", "field": "val.doc_count"},
      "range": [{"signal": "bandwidth('groupScale')"}, 0]
    },
    {
      "name": "colorScale",
      "type": "ordinal",
      "domain": {"data": "rawdata", "field": "key", "sort": true},
      "range": "category"
    }
  ],
  "axes": [
    {"orient": "bottom", "scale": "xScale", "tickCount": 5}
  ],
  "signals": [
    {
      "name": "currentX",
      "value": -1,
      "on": [
        {"events": "view:mousemove", "update": "clamp(x(), 0, width)"},
        {"events": "view:mouseout", "update": "-1"}
      ]
    },
    {
      "name": "selected",
      "value": [0, 0],
      "on": [
        {"events": "@grapharea:mousedown", "update": "[x(), x()]"},
        {
          "events": "[@grapharea:mousedown, window:mouseup] > window:mousemove!",
          "update": "[selected[0], clamp(x(), 0, width)]"
        },
        {
          "events": {"signal": "delta"},
          "update": "clampRange([anchor[0] + delta, anchor[1] + delta], 0, width)"
        },
        {
          "events": "[@leftEdge:mousedown, window:mouseup] > window:mousemove!",
          "update": "[clamp(x(), 0, width), selected[1]]"
        },
        {
          "events": "[@rightEdge:mousedown, window:mouseup] > window:mousemove!",
          "update": "[selected[0], clamp(x(), 0, width)]"
        }
      ]
    },
    {
      "name": "anchor",
      "value": null,
      "on": [
        {"events": "@selectedRect:mousedown", "update": "selected"}
      ]
    },
    {
      "name": "xDown",
      "value": 0,
      "on": [
        {"events": "@selectedRect:mousedown", "update": "x()"}
      ]
    },
    {
      "name": "delta",
      "value": 0,
      "on": [
        {"events": "[@selectedRect:mousedown, window:mouseup] > window:mousemove!", "update": "x() - xDown"}
      ]
    },
    {
      "name": "applyTimeFilter",
      "on": [
        {
          "events": "@applyTimeFilterButton:click, @selectedRect:dblclick",
          "update": "opensearchDashboardsSetTimeFilter(invert('xScale',selected[0]), invert('xScale',selected[1]))"
        },
        {"events": "@grapharea:dblclick", "update": "opensearchDashboardsSetTimeFilter('now-15d', 'now')"}
      ]
    }
  ],
  "marks": [
    {
      "name": "grapharea",
      "type": "group",
      "from": {
        "facet": {"name": "facets", "data": "rawdata", "field": "time_buckets.buckets"}
      },
      "encode": {
        "update": {
          "y": {"scale": "groupScale", "field": "key"},
          "height": {"scale": "groupScale", "band": 1},
          "x": {"value": 0},
          "width": {"signal": "width"},
          "fillOpacity": {"value": 0},
          "fill": {"value": "#000"},
          "tooltip": {
            "signal": "{'Service': datum['key']}"
          }
        }
      },
      "axes": [
        {
          "orient": "left",
          "scale": "yScale",
          "title": {"signal": "parent.key"},
          "tickCount": 4,
          "encode": {
            "title": {
              "name": "extFilter",
              "interactive": true,
              "update": {
                "cursor": {"value": "pointer"},
                "fontSize": {"value": 8},
                "fill": {"value": "steelblue"}
              },
              "hover": {
                "fill": {"value": "firebrick"}
              }
            }
          }
        },
        {
          "orient": "right",
          "scale": "durationScale",
          "tickCount": 4,
          "title": {"signal": "parent.key"},
          "encode": {
            "title": {
              "name": "extErrorFilter",
              "interactive": true,
              "update": {
                "cursor": {"value": "pointer"},
                "fontSize": {"value": 8},
                "fill": {"value": "red"}
              },
              "hover": {
                "fill": {"value": "firebrick"}
              }
            }
          }
        }
      ],
      "signals": [
        {
          "name": "updateErrFilterObj",
          "on": [
            {
              "events": {"source": "scope", "markname": "extErrorFilter", "type": "click"},
              "update": "{'match': {'status.code': {'query': 2, 'type': 'phrase'}}}"
            }
          ]
        },
        {
          "name": "applyErrorFilterObj",
          "on": [
            {
              "events": {"signal": "updateErrFilterObj"},
              "update": "length(domain('groupScale')) > 1 ? opensearchDashboardsAddFilter(updateErrFilterObj) : opensearchDashboardsRemoveFilter(updateErrFilterObj)"
            }
          ]
        },
        {
          "name": "updateFilterObj",
          "on": [
            {
              "events": {"source": "scope", "markname": "extFilter", "type": "click"},
              "update": "{'match': {'serviceName': {'query': parent.key, 'type': 'phrase'}}}"
            }
          ]
        },
        {
          "name": "applyFilterObj",
          "on": [
            {
              "events": {"signal": "updateFilterObj"},
              "update": "length(domain('groupScale')) > 1 ? opensearchDashboardsAddFilter(updateFilterObj) : opensearchDashboardsRemoveFilter(updateFilterObj)"
            }
          ]
        }
      ],
      "marks": [
        {
          "type": "line",
          "from": {"data": "facets"},
          "interactive": false,
          "encode": {
            "update": {
              "x": {"scale": "xScale", "field": "key"},
              "y": {"scale": "yScale", "field": "doc_count"},
              "fill": {"scale": "colorScale", "field": {"parent": "key"}},
              "fillOpacity": {"value": 0.2},
              "stroke": {"scale": "colorScale", "field": {"parent": "key"}}
            }
          }
        },
        {
  "type": "rect",
  "from": {
    "data": "facets"
  },
  "encode": {
    "update": {
      "x": {
        "scale": "xScale",
        "field": "key"
      },
      "width": { "value": 15},
"cornerRadius": { "value": 5 }
      "y": {
        "scale": "durationScale",
        "field": "duration.value",
        "offset": -3
      },
      "y2": {"scale": "durationScale", "value": 0}

      "stroke": {"value":"black"},
      "fill":   {"scale": "colorScale", "field": {"parent": "key"}},
      "fillOpacity": {"value": 0.8},

      "tooltip": {
        "signal": "{'Date': timeFormat(datum['key'], '%Y-%m-%d %H:%M'), 'Value': datum['duration']}"
      }
    }
  }
},
        {
          "type": "symbol",
          "style": ["point"],
          "from": {
            "data": "facets"
          },
          "encode": {
            "update": {
              "x": {
                "scale": "xScale",
                "field": "key"
              },
              "y": {
                "scale": "yScale",
                "field": "doc_count"
              },
              "size": {
                "value": 8
              },
              "stroke": {"scale": "colorScale", "field": {"parent": "key"}},
              "tooltip": {
                "signal": "{'Date': timeFormat(datum['key'], '%Y-%m-%d %H:%M'), 'Value': datum['doc_count']}"
              }
            }
          }
        },
        {
          "type": "group",
          "from": {"data": "hasSelection"},
          "marks": [
            {
              "name": "selectedRect",
              "type": "rect",
              "encode": {
                "update": {
                  "height": {"scale": "groupScale", "band": 1},
                  "fill": {"value": "#333"},
                  "fillOpacity": {"value": 0.2},
                  "cursor": {"value": "move"},
                  "x": {"signal": "selected[0]"},
                  "x2": {"signal": "selected[1]"}
                }
              }
            },
            {
              "name": "leftEdge",
              "type": "rect",
              "encode": {
                "update": {
                  "height": {"scale": "groupScale", "band": 1},
                  "width": {"value": 2},
                  "fill": {"value": "firebrick"},
                  "cursor": {"value": "ew-resize"},
                  "x": {"signal": "selected[0]"}
                }
              }
            },
            {
              "name": "rightEdge",
              "type": "rect",
              "encode": {
                "update": {
                  "height": {"scale": "groupScale", "band": 1},
                  "width": {"value": 2},
                  "fill": {"value": "firebrick"},
                  "cursor": {"value": "ew-resize"},
                  "x": {"signal": "selected[1]"}
                }
              }
            }
          ]
        }
      ]
    },
    {
      "type": "group",
      "name": "applyTimeFilterButton",
      "from": {"data": "hasSelection"},
      "encode": {
        "update": {
          "cursor": {"value": "pointer"},
          "cornerRadius": {"value": 6},
          "fill": {"value": "#f5f5f5"},
          "stroke": {"value": "#c1c1c1"},
          "strokeWidth": {"value": 2},
          "xc": {"signal": "width/2"},
          "y": {"value": 30},
          "width": {"value": 80},
          "height": {"value": 30},
          "opacity": {"value": 1}
        },
        "hover": {
          "opacity": {"value": 0.7}
        }
      },
      "marks": [
        {
          "type": "text",
          "interactive": false,
          "encode": {
            "update": {
              "xc": {"field": {"group": "width"}, "mult": 0.5},
              "yc": {"field": {"group": "height"}, "mult": 0.5, "offset": 2},
              "align": {"value": "center"},
              "baseline": {"value": "middle"},
              "fontWeight": {"value": "bold"},
              "text": {"value": "Apply Filter"}
            }
          }
        }
      ]
    },
    {
      "type": "rule",
      "interactive": false,
      "encode": {
        "update": {
          "y": {"value": 0},
          "y2": {"signal": "height"},
          "stroke": {"value": "gray"},
          "strokeDash": {"value": [2, 1]},
          "x": {"signal": "max(currentX,0)"},
          "strokeOpacity": {"signal": "currentX > 0 ? 1 : 0"}
        }
      }
    }
  ]
}
"}}
